svg.script:
'use strict';

var map     = document.querySelector('.map'),
    regions = document.querySelectorAll('.region'),
    labels  = document.querySelector('.labels');

var selectElement = function(element) {
  element.setAttribute('data-selected', 'true');
};

var toggleAttribute = function(element, attribute, option1, option2) {
  option1 = typeof option1 !== 'undefined' ?  option1 : 'true';
  option2 = typeof option2 !== 'undefined' ?  option2 : 'false';
  element.setAttribute('data-' + attribute, element.getAttribute('data-' + attribute) === option1 ? option2 : option1);
};

var deselectAllRegions = function() {
  // iterate through regions using a backwards loop...
  // ...because "less-than" sign throws error in XML
  for (var i = regions.length; i--;) {
    regions[i].setAttribute('data-selected', 'false');
  }
};

var handleHover = function(event) {
  // if a label is hovered
  if (event.target.parentNode.getAttribute('class') === 'label') {
    var regionName = event.target.parentNode.getAttribute('data-name');
    var region = map.querySelector('[data-name="' + regionName + '"]');
    // toggle hovered data attribute
    toggleAttribute(region, 'hovered');
  }
};

var handleClicks = function(event) {
  var region, regionName;
  // if a state is clicked
  if (event.target.parentNode.getAttribute('class') === 'region') {
    region = event.target.parentNode;
  }
  // if a label is clicked
  if (event.target.parentNode.getAttribute('class') === 'label') {
    regionName = event.target.parentNode.getAttribute('data-name');
    region = map.querySelector('[data-name="' + regionName + '"]');
  }
  // select region
  deselectAllRegions();
  selectElement(region);
  // re-assign regionName, in case it wasn't set before
  regionName = region.getAttribute('data-name');
  updateInfoText(regionName);
  updateInfoBackground(regionName);
};

map.addEventListener('click',    handleClicks, false);
labels.addEventListener('click', handleClicks, false);

labels.addEventListener('mouseover', handleHover, false);
labels.addEventListener('mouseout',  handleHover, false);
